                                                    width: '100%',
                                                    borderTopLeftRadius: key === 0 ? '5px' : '0px',
                                                    borderTopRightRadius: key === 0 ? '5px' : '0px',
                                                    borderBottomLeftRadius: key === menu.length - 1 ? '5px' : '0px',
                                                    borderBottomRightRadius: key === menu.length - 1 ? '5px' : '0px',
