                                                    marginTop: '-2px',
                                                    cursor:  'pointer',
                                                    justifyContent: 'flex-start',
                                                    zIndex: '199',
                                                    ...stylesMenuMobile
                                                    }} key={key} variant={variant} type="filled" caption={element.caption} onClick={() => {toggleDropdownExpandedWrap(-1); setShowLeftMenu(false); clickMenu(element.link, element.component)}}/>
